import React, { Component } from 'react';
var { Provider, Consumer } = React.createContext({});

class Second extends Component {
    render() {
        return (
            <div>
                <Consumer>
                    我是第二个组件<hr/>
                    {
                        (val)=> <div>名字：{val.name}，年龄：{val.age}</div>
                    }
                </Consumer>
            </div>
        );
    }
}

export default Second;
